import React, { Fragment } from 'react';

const APIs = () => {
  return (
    <Fragment>
      <div className='container'>
        <h1>
          <i className='fas fa-exclamation-triangle'></i> List of APIs
        </h1>
        <ul>'https://jsonplaceholder.typicode.com/posts'</ul>
      </div>
    </Fragment>
  );
};

export default APIs;
